import "../meio/meio.css";
import "../meio/janela/janela";
import Janela from "../meio/janela/janela";

function Meio({ conteudo }) {
  return (
    <div className="meio">
      <Janela>
        {conteudo === "clientes" && <div>Dados de Clientes</div>}
        {conteudo === "contratos" && <div>Dados de Contratos</div>}
        {conteudo === "produtos" && <div>Dados de Produtos</div>}
        {conteudo === "fornecedor" && <div>Dados de Fornecedores</div>}
        {conteudo === "estruturas" && <div>Dados de Estruturas</div>}
        {conteudo === "central" && <div>Dados da Central de Consultas</div>}
        {!conteudo && <div>Selecione uma opção no menu.</div>}
      </Janela>
    </div>
  );
}

export default Meio;
